  public onCreateOrUpdate(action:string, entityName: string, entity: any) {
    action = (action || '').toString().toLocaleLowerCase().trim();
    switch((entityName || '').toString().trim().toLocaleLowerCase()) {
      case 'employee':
        if(action === 'create') {
          entity.EmployeeNumber = this.getNewEmployeeNumber(entity.PositionId, entity.EmploymentTypeId);
        }
        entity.BirthDate = this.getSAIdNumberBirthDate(entity.IdNumber);
        break;
      case 'project':
        entity.MaximumHoursAllocated = this.calculateMaximumHoursAllocated(entity.StartDate, entity.EndDate);
        break;
      case 'projectworklog':
      case 'taskworklog':
        entity.HoursWorked = this.calculateTotalHoursWorked(entity.StartDate, entity.EndDate);
        break;
    }
  }

